import React from 'react';
import { Table } from 'antd';

const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
    },
    {
      title: 'Crag',
      dataIndex: 'crag',
    },
    {
      title: 'Sector',
      dataIndex: 'sector',
    },
];

class PathsList extends React.Component {

    addKeysToElements = () => {
        console.log("dopisane");
        this.props.elements.map( element => element.key = element.name + element.crag + element.sector)
    }

    render() {
        // this.addKeysToElements()
        console.log("to");
        console.log(this.props.elements);
        return (
            <Table columns={columns} dataSource={this.props.elements} size="middle" rowKey="name"/>
        );
    }
}

export default PathsList;
